    - Samuel L. Paley Library
    - Centrally located on Main Campus, this building holds the majority of the University Libraries'
      book and journal collections in most subject areas, including business, humanities, the sciences,
      and social sciences.

      It is also home to the University Libraries' administrative offices, the Special Collections
      Research Center, Urban Archives, the University Archives, the microforms collections and
      reader/printers, and a limited number of study rooms.
