    - Law Library
    - The Temple University Beasley School of Law Library has a long history as a research library
      and as a service-oriented facility to the Law School. It survived a fire in 1972 at which time
      students, staff and other members of the Temple community passed books out of the burning
      building until it became too dangerous and they were ordered to stop. They managed to save a
      large number of rare and valuable volumes, but more than 150,000 books were destroyed. The
      library has since that time restored and enriched its collection.
    - 1719 N. Broad Street, Philadelphia, PA, 19122
