  - - 6
    - Temple Rome Library
    - The Temple University Rome Library supports undergraduate and graduate courses with a
      collection of approximately 15,000 volumes, 280 subtitled video-films, and 25 periodical and
      newspaper subscriptions. The collection focuses on architecture, art, art history, business,
      and the humanities and social sciences. Most of the collection is English language and focuses
      on Italy-related subjects. It is one of the largest English language libraries in Rome, and in
      the field of international study.

      The library also maintaiins rare and precious books, a
      contemporary artists' archive, and a collection of past exhibit announcements of Temple's
      visual arts faculty and students.

      There is no Interlibrary loan service available to or from the
      library, nor Intralibrary loans between other Temple campuses. Access to the library is limited
      to persons currently affiliated with Temple University.
    - Rome, Italy
    - 'ROME'
