    - '2018-07-05 14:40:08.094579'
  - - 7
    - Temple Tokyo Library
    - Temple University Japan Campus Library System Tokyo and Osaka The Temple University Japan
      Campus Library System consists of two library facilities, one at each of TUJ's two Japan
      Tokyo and Osaka. Each facility is designed to serve the needs of the resident
      faculty and students. The Tokyo location houses the bulk of the 55,000 volume general
      collection, while the Osaka library houses specialized collections to support graduate
      studies in linguistics. Special strengths of the general collection include American
      studies, Japanese studies, language and linguistics, Asian history, art history and
      religion. In addition to book and journal holdings, the TUJ library holds a collection of
      over 2,500 feature films and documentaries.
