    - Staff Recognition Award
    - Library staff members at all levels play a crucial role in delivering library
      services. Some of these services are quite visible and are provided at public
      service desks, while many other services are provided by staff members working
      behind the scenes. Regardless of the setting, it is only through the coordinated
      efforts of many dedicated individuals that the Libraries are able to meet the needs
      of the University's students, faculty and staff. In order to provide a more formal
      and permanent recognition of these efforts, the Libraries present an annual Staff
      Recognition Award to an individual who has excelled in superior performance and
